import sys
import os
import subprocess

class bcolors:
    HEADER = '\033[95m'
    OKBLUE = '\033[94m'
    OKGREEN = '\033[92m'
    WARNING = '\033[93m'
    FAIL = '\033[91m'
    ENDC = '\033[0m'
    BOLD = '\033[1m'
    UNDERLINE = '\033[4m'

pass_count = 0
fail_count = 0

def check_individual_results(cm, t):
    p = subprocess.Popen(cm, shell=True, stdout=subprocess.PIPE)
    x = p.communicate()
    #print(x)
    x = x[0].lstrip().decode("utf-8")
    if x == t:
        print(bcolors.OKGREEN + "PASSED" + bcolors.ENDC)
        global pass_count
        pass_count += 1
        return True
    else:
        for i,j in zip(x,t):
            print(i, j, i == j)
        print(bcolors.FAIL + "FAILED" + bcolors.ENDC)
        print("intended output:\n", t)
        print("your output:\n", x)
        global fail_count
        fail_count += 1
        return False

def print_success(res):
    if res:
        print(bcolors.OKBLUE + "PASSED" + bcolors.ENDC)
    else:
        print(bcolors.FAIL + "FAILED" + bcolors.ENDC)
    
